INFO_JSON[4] = '{"background":"images/info.png?201306021050","sprites":"images/intro_sprites.png?201306071630","textDataArray":[{"font":"18px Arial","color":"black","content":"The land of Connecht was haunted by the evil wizard, Scalito.","location":{"x":40,"y":56}},{"font":"18px Arial","color":"black","content":"A mighty sorcerer, his dark magics conferred him near invincibility.","location":{"x":79,"y":82}},{"font":"18px Arial","color":"black","content":"Yet Scalito had one weakness....","location":{"x":85,"y":108}},{"font":"18px Arial","color":"black","content":"repeated whacks with an axe would kill him.","location":{"x":87,"y":134}},{"font":"18px Arial","color":"black","content":"This lone vulnerability represented the only obstacle to his","location":{"x":46,"y":160}},{"font":"18px Arial","color":"black","content":"conquest of Connecht.","location":{"x":48,"y":186}},{"font":"18px Arial","color":"black","content":"Manro, wielder of the famed golden axe of Nerwulk, and greatest ","location":{"x":47,"y":212}},{"font":"18px Arial","color":"black","content":"axe swinger in all the land, kept Scalito\'s evil in check.","location":{"x":49,"y":238}},{"font":"18px Arial","color":"black","content":"Scalito employed great treachery, and framed Manro for","location":{"x":49,"y":264}},{"font":"18px Arial","color":"black","content":"a jaywalking crime he did not commit.","location":{"x":50,"y":290}},{"font":"18px Arial","color":"black","content":"Manro was imprisoned in the cursed dungeons of Grunwitch. ","location":{"x":108,"y":316}},{"font":"18px Arial","color":"black","content":"His golden axe, stolen by Scalito, was taken to the wizard\'s","location":{"x":109,"y":342}},{"font":"18px Arial","color":"black","content":"tower.","location":{"x":109,"y":368}},{"font":"18px Arial","color":"black","content":"Connecht\'s only hope was that Manro could somehow escape,","location":{"x":43,"y":394}},{"font":"18px Arial","color":"black","content":"reclaim his legendary axe, and defeat Scalito once and for all.","location":{"x":44,"y":420}},{"font":"20px Arial","color":"black","content":"","location":{"x":70,"y":344}}],"spriteDataArray":[{"tile":0,"location":{"x":32,"y":59}},{"tile":1,"location":{"x":497,"y":233}},{"tile":2,"location":{"x":503,"y":224}},{"tile":3,"location":{"x":32,"y":301}}]}';
INFO_JSON[5] = '{"background":"images/info.png?201306161549","sprites":"images/intro_sprites.png?201306161549","textDataArray":[{"font":"20px Arial","color":"black","content":"Manro emerged from the dungeons and breathed the","location":{"x":75,"y":70}},{"font":"20px Arial","color":"black","content":"foul, frigid air of Grunwitch.","location":{"x":74,"y":97}},{"font":"20px Arial","color":"black","content":"Luckily for Manro, Scalito was a disorganized slob","location":{"x":74,"y":175}},{"font":"20px Arial","color":"black","content":"who littered the dungeons with useful weapons and keys.","location":{"x":74,"y":205}},{"font":"20px Arial","color":"black","content":"Unluckily for Manro, the rusty axe he found in his cell","location":{"x":85,"y":257}},{"font":"20px Arial","color":"black","content":"crumbled in the harsh light of the sun.","location":{"x":83,"y":284}},{"font":"20px Arial","color":"black","content":"Finding himself unarmed once more, Manro hoped","location":{"x":84,"y":356}},{"font":"20px Arial","color":"black","content":"fortune would provide him a replacement weapon.","location":{"x":84,"y":380}},{"font":"20px Arial","color":"black","content":"The road out of Grunwitch would not be easy...","location":{"x":82,"y":423}}],"spriteDataArray":[{"tile":5,"location":{"x":322,"y":81}},{"tile":4,"location":{"x":410,"y":264}}]}';

